var Animal=function(breed,age,price){this.breed=breed,this.age=age,this.price=price};Animal.prototype.sumTotalPrice=function(){console.log(this.age+2*this.price)};var mic=new Animal("dog",1,1e3);mic.sumTotalPrice();var years=[1990,1992,2001,2e3,1989];function arrCalc(arr,callback){var temp=[];for(let i=0;i<arr.length;i++)temp.push(callback(arr[i]));return temp}function calculateAge(num){return 2020-num}var ages=arrCalc(years,calculateAge);function interviewQuestion(job){return"designer"===job?function(name){console.log(name+", Oh! You are a designer")}:"developer"===job?function(name){console.log(name+", Nice! We got a Developer")}:function(name){console.log(name+", What do you do?")}}console.log(ages);var developerQuestion=interviewQuestion("developer");developerQuestion("Hoang"),interviewQuestion("designer")("Vu");